import React, { useEffect, useState } from 'react';
import { NavLink } from 'react-router-dom';
import CanHelp from '../../posthelper/canhelp';
import g from './../../posthelper/module.css'

     
const CanHelpA=(props)=>{
        return (
                <div>
                        <div className='test'>
                                <NavLink to={'/addcanhelp'}> <button className='test' type="button">Могу помочь!</button></NavLink>
                        </div>
                        <CanHelp />

                </div>
                );
}
export default CanHelpA
